script: |
  super -f text -I q8094.spq | sort > q8094.out

inputs:
  - name: q8094.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - ( 84 ) + - - col1 BETWEEN + 59 AND NULL;
  - name: tab2

outputs:
  - name: q8094.out
    data: |
      -23
      -40
      -58
